import React from 'react';
import { FlatList, StyleSheet, Text, View, Pressable } from 'react-native';

const onClick = () => {
  alert("lol");
}

const FlatListBasics = () => {
    return (
      <View style={styles.container}>
        <FlatList
          data={[
            {key: 'Devin'},
            {key: 'Dan'},
            {key: 'Dominic'},
            {key: 'Jackson'},
            {key: 'James'},
            {key: 'Joel'},
            {key: 'John'},
            {key: 'Jillian'},
            {key: 'Jimmy'},
            {key: 'Julie'},
          ]}
          renderItem={({item}) => {<Pressable onPress={onClick}>
            <Text style={styles.item}>{item.key}</Text>
          </Pressable>}}
        />
      </View>
    );
  }

  const styles = StyleSheet.create({
    container: {
     flex: 1,
     paddingTop: 22
    },
    item: {
      padding: 10,
      fontSize: 18,
      height: 44,
    },
  });
export default FlatListBasics;
